import React, { Component } from 'react'
import MealItem from "./MealItem"

 class Meal extends Component {
    render() {
        return (
            <div style ={{display: "flex" ,flexDirection: "row"}}>
                <div>
                {this.props.meals.map(meal => (
                   <MealItem user ={meal}/>
                ))}
                </div>


            </div>
        )
    }
}

export default Meal
